import React, { Component } from 'react';
import {Link} from 'react-router-dom';

class Home extends Component {
    render() {
        return (
            <div>
                <link class="btn btn-primary" to="/formuPerso" role="button">Registrar</link>
            </div>
        )
    }
}

export default Home;
